import React from 'react';
import PropTypes from 'prop-types';
import { useRiskMatrixStore } from '../stores/riskMatrixStore';
import ICAORiskMatrix from './ICAORiskMatrix';
import IntegratedRiskMatrix from './IntegratedRiskMatrix';
import { calculateICAORiskTolerability } from '../utils/riskCalculations';

export default function AssessmentForm({ groupedAssessments, setValue, onSubmit, isSubmitting }) {
  const { matrixType } = useRiskMatrixStore();

  const handleMatrixChange = (assessmentId, values) => {
    try {
      // Create a flat array of all assessments with their form indices
      const assessmentsList = [];
      Object.values(groupedAssessments).forEach(group => {
        group.assessments.forEach((assessment, index) => {
          assessmentsList.push({
            assessment,
            formIndex: assessmentsList.length // Use the current length as the form index
          });
        });
      });

      // Find the assessment by consequence_id
      const assessmentInfo = assessmentsList.find(info =>
        info.assessment.consequence_id === assessmentId
      );

      if (!assessmentInfo) {
        console.error('Assessment not found for consequence_id:', assessmentId);
        return;
      }

      console.log('Updating assessment for consequence_id:', assessmentId, 'at index:', assessmentInfo.formIndex, 'with values:', values);

      if (matrixType === 'ICAO') {
        setValue(`assessments.${assessmentInfo.formIndex}.probability`, values.probability);
        setValue(`assessments.${assessmentInfo.formIndex}.severity`, values.severity);
        if (values.probability && values.severity) {
          const tolerability = calculateICAORiskTolerability(values.probability, values.severity);
          setValue(`assessments.${assessmentInfo.formIndex}.tolerability`, tolerability);
        }
      } else {
        setValue(`assessments.${assessmentInfo.formIndex}.likelihood`, values.likelihood);
        setValue(`assessments.${assessmentInfo.formIndex}.impact`, values.impact);
      }
    } catch (error) {
      console.error('Error updating matrix values:', error);
    }
  };

  // Create a flat array of all assessments for form submission
  const allAssessments = [];
  Object.values(groupedAssessments).forEach(group => {
    group.assessments.forEach(assessment => {
      allAssessments.push(assessment);
    });
  });

  return (
    <form onSubmit={onSubmit} className="space-y-6">
      {Object.entries(groupedAssessments).map(([eventId, { event, assessments }]) => (
        <div key={eventId} className="bg-white rounded-lg shadow p-6">
          <h3 className="text-xl font-semibold text-gray-800 mb-4">{event}</h3>

          <div className="space-y-6">
            {assessments.map((assessment) => {
              // Find the index in the flat array
              const assessmentIndex = allAssessments.findIndex(a => a.consequence_id === assessment.consequence_id);

              return (
                <div key={assessment.consequence_id} className="bg-gray-50 rounded-lg p-4">
                  <div className="mb-4">
                    <h4 className="font-medium text-gray-700">Hazard</h4>
                    <p className="text-gray-600">{assessment.hazard}</p>
                  </div>

                  <div className="mb-4">
                    <h4 className="font-medium text-gray-700">Consequence</h4>
                    <p className="text-gray-600">{assessment.consequence}</p>
                  </div>

                  <div className="mb-4">
                    <h4 className="font-medium text-gray-700">Current Controls</h4>
                    <p className="text-gray-600">{assessment.currentControls}</p>
                  </div>

                  {matrixType === 'ICAO' ? (
                    <ICAORiskMatrix
                      key={`matrix-${assessment.consequence_id}`}
                      probability={assessment.probability}
                      severity={assessment.severity}
                      onChange={(values) => handleMatrixChange(assessment.consequence_id, values)}
                      showTolerability={true}
                      tolerability={assessment.tolerability}
                    />
                  ) : (
                    <IntegratedRiskMatrix
                      key={`matrix-${assessment.consequence_id}`}
                      likelihood={assessment.likelihood}
                      impact={assessment.impact}
                      onChange={(values) => handleMatrixChange(assessment.consequence_id, values)}
                      showRiskLevel={true}
                    />
                  )}
                </div>
              );
            })}
          </div>
        </div>
      ))}

      <div className="flex justify-end">
        <button
          type="submit"
          disabled={isSubmitting}
          className={`px-4 py-2 bg-blue-600 text-white rounded-md hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:ring-offset-2 transition-colors duration-200 ${
            isSubmitting ? 'opacity-50 cursor-not-allowed' : ''
          }`}
        >
          {isSubmitting ? 'Saving...' : 'Next Step'}
        </button>
      </div>
    </form>
  );
}

AssessmentForm.propTypes = {
  groupedAssessments: PropTypes.object.isRequired,
  setValue: PropTypes.func.isRequired,
  onSubmit: PropTypes.func.isRequired,
  isSubmitting: PropTypes.bool
};
